        <p>Here on POEMS FOR CY we ask users to do the opposite-- create poetry inspired by artworks themselves.</p>
        <p>Users can build on eachother's lines, creating a confluence of varying styles, perspectives and influences.</p>
        </div>
        <br></br>
        <br></br>
    </div>
  ); 

  export default Home;
